import SearchBar from "../SearchBar/SearchBar";

function NavBar(props) {
    return (
        <div>
            <div>
                <a href="../../public/index.html">
                    <img src="../../img/logo.png" alt="logo" />
                </a>
            </div>
            <div>
                <SearchBar/>
            </div>
      </div>
   );
}

export default NavBar;
